import React from "react";
import { Header, Footer } from "../components/mollecules";
import { Forms } from "../components/organismes";
import { useAuth } from "../context";
import { useHistory } from "react-router-dom"; // Importez useHistory depuis react-router-dom


function Profile() {
  const { profile, isLoggedIn, signOut } = useAuth();

  const history = useHistory();

  return (
    <div>
      {isLoggedIn ? (
        <div className="min-h-screen flex flex-col justify-between">
          <div>
            <Header.LaptopHeader />
            <div>le profil</div>
          </div>
          <div>
            <Footer.laptopFooter />
          </div>
        </div>
      ) : (
        history.push("/connexion")
      )}
    </div>
  );
}

export default Profile;
